  "1.5" : {
    "guid" : "025da6f4-b1b6-423a-8c0f-b324f531a6f1",
    "key" : "1.5",
    "abbr" : "1.5",
    "name" : "Planta",
    "description" : "Utilice este campo para palabras que generalmente tienen que ver con todas las plantas. Use un libro con imágenes para identificar los nombres de plantas y el nombre científico. Los idiomas dividen las plantas en varios campos que no siempre son comparables de idioma a idioma. El estándar de los rasgos puede ser su uso y sus características (los árboles y las ramas se distinguen por el tamaño y el número de Troncos, y la hierba y la mala hierba se distinguen por ser o no deseables). Algo que comúnmente distingue a los árboles entre los que no lo son es que los árboles son descritos como grandes, de madera y de un pronóstico de vida de varios años, mientras que los que no lo son pequeños, no son de madera y tienen un pronóstico de vida no mayor que de un año (Heine, Bernd y Karsten Legere. 1995. Plantas Swahili. Rudiger Koppe Verlag: Koln.). Las sociedades agricultoras dividen las plantas entre silvestres y domésticas (cultivables). No obstante, la mayoría de las plantas con nombre tienen algún uso. Por lo tanto, no parece ser de utilidad dividir los nombres de las plantas entre los campos de plantas útiles y no-útiles. Ya que sólo unas partes de las plantas se comen, las partes comestibles son clasificadas bajo el campo de ”Comida”. Puede que algunos idiomas tengan más campos de los que se utilizan en esta lista, algunos otros pueden tener menos. El sistema de clasificación que se utiliza aquí puede no coincidir completamente con el sistema utilizado por los botánicos. Por ejemplo, los botánicos no clasifican juntas todas las especies de los árboles. Las palmeras pertenecen a la clase Monocotiledónea y se clasifican con los lirios, con los platanales y con las orquídeas. Los manzanos y los cerezos son árboles que pertenecen a la clase Dicotiledónea y están clasificados en la familia del rosal junto con las rosas y las zarzamoras. El árbol de la acacia también pertenece a la clase Dicotiledónea y se clasifica en la familia del pulso junto con los lupinos y con los frijoles. No obstante, la mayoría de de las taxonomías populares ponen juntos a todos los árboles. El sistema científico de clasificación de las plantas y de los animales se toma de: Carruth, Gorton, ed. 1989. Volúmenes 1 y 2 del Volumen de la Biblioteca. La Compañia del Suroeste: Nashville.",
    "value" : "1.5 Planta"
  },
  "1.5.1" : {
    "guid" : "0ee5b933-f1ab-485f-894a-51fe239cb726",
    "key" : "1.5.1",
    "abbr" : "1.5.1",
    "name" : "Árbol",
    "description" : "Utilice este campo para árboles--plantas que florean, que tienen raíces, tallos, y hojas, además, son grandes y tienen un tronco de madera (Filum Spermatophyta, Subdivisión de Angiospermas). También incluye a los árboles de hoja perenne (Filum Spermatophyta, Subdivisión Gimnospermas). Los árboles de hoja perenne no tienen flores, pero tienen piñitas (conos en forma de piña) que contienen semillas. Sus hojas son puntiagudas y se mantienen por todo el año.",
    "value" : "1.5.1 Árbol"
  },
  "1.5.2" : {
    "guid" : "531af868-b5fb-41c2-ba50-764458f9102f",
    "key" : "1.5.2",
    "abbr" : "1.5.2",
    "name" : "Arbusto, maleza, matorral",
    "description" : "Utilice este campo para los arbustos, la maleza y los matorrales--plantas que son más pequeñas que los árboles y que tienen distintos troncos de madera (filum Spermatophyta, Subdivisión de Angiosperma).",
    "value" : "1.5.2 Arbusto, maleza, matorral"
  },
  "1.5.3" : {
    "guid" : "c345f278-91ff-463d-b9a6-8abac8a267eb",
    "key" : "1.5.3",
    "abbr" : "1.5.3",
    "name" : "Césped/pasto, hierba, enredadera",
    "description" : "Utilice este campo para las plantas pequeñas que tienen raíces, tallos, flores y semillas, pero que no tienen un tronco de madera (Filum Spermatophyta, Subdivisión de Angiosperma). También incluye las plantas sin semillas, como los helechos, (filum Pteridofita, clase Felicineae), cola de caballo, (filum Pteridofita, clase Equisetíneas), y los musgos (filum Pteridofita, clase Licopodíneas). Las plantas de la familia filum Pteridofita no tienen flores ni semillas. Los helechos tienen hojas grandes y separadas, parecidas a las plumas, o a la fronda. Los musgos son pequeños (rara vez llegan a un metro), plantas de hoja perenne de hojas sencillas y puntiagudas, semejantes al pino o al abeto. A veces crecen verticalmente, pero con frecuencia se arrastran sobre el suelo, propagándose por donde pasan. Las cola de caballo se mueve sobre tallos altos, verticales, donde se une con ramas cubiertas con escamas como hojas.",
    "value" : "1.5.3 Césped/pasto, hierba, enredadera"
  },
  "1.5.4" : {
    "guid" : "d06dae77-134a-403f-ba88-52ecd66c0522",
    "key" : "1.5.4",
    "abbr" : "1.5.4",
    "name" : "Musgo, hongos, alga",
    "description" : "Utilice este campo para musgos (filum Briofita, clase de Musí), (filum Briofita, clase de Hepáticas), hongos(filum Thallophyta, subdivisión Fungi), algas (filum Thallophyta, subdivisión Algae), y líquenes. En realidad estas plantas no tienen raíces, tallos, u hojas. Los musgos son plantas pequeñas, verdes y sin flores que crecen en ambientes húmedos y parecen aterciopeladas o con plumaje, alfombrando el suelo, los troncos de árboles y las rocas. Los liverworts se parecen a los musgos, con un patrón de crecimiento plano y de ramificación. Las algas poseen clorofila. Estas varían de un organismo unicelular (el cual vive en ocasiones en colonias como es el verdín de estanques), a organismos complejos como las algas marinas. Los hongos no poseen clorofila y se alimentan de otros materiales orgánicos. Los líquenes consisten de de la combinación de un hongo y de un alga que crecen juntos. Estos, usualmente crecen en troncos de árboles y rocas. Algunos son planos y con hojas, y otros son como el musgo.",
    "value" : "1.5.4 Musgo, hongos, alga"
  },
  "1.5.5" : {
    "guid" : "d117aa22-3f18-47c4-9683-51ecf1dc7134",
    "key" : "1.5.5",
    "abbr" : "1.5.5",
    "name" : "Partes de una planta",
    "description" : "Utilice este campo para palabras que se refieran a las partes de una planta. Inicie con palabras generales que tengan todas las plantas. Luego piense en cada clase mayor de planta. Termine pensando en plantas específicas que son bien conocidas (usualmente cosechas cultivadas) y que tengan palabras para las partes especificas (ejemplo, borla en una mazorca/mazorca de maíz).",
    "value" : "1.5.5 Partes de una planta"
  },
