    "description" : "Utilice este campo para las palabras que describan las clases de animales. Utilice un libro con imágenes para identificar cada especie y su nombre científico. Esta sección está organizada de acuerdo con las clasificaciones científicas y biológicas de los animales. Puede ser que no corresponda a la clasificación local de los animales (taxonomía popular), que se basa a menudo en cómo la gente se relaciona con los animales (doméstico/salvaje, comestible/trabajo). Utilice este campo para palabras que tienen que ver con grandes clases de animales que no corresponden a la clasificación científica. Por ejemplo, este lugar será para una palabra como “animal volador” el cual incluye aves, murciélagos, e insectos voladores.",
