    "description" : "Utilice este campo para los nombres de las especies de los insectos (filum Artrópodo, clase Insecto). Observe que los insectos tienen seis patas y las arañas tienen ocho patas. De cualquier modo, algunos idiomas no distinguen a los insectos de las arañas y puede ser que utilicen otras características para subdividir a los artrópodos.",
