    "abbr" : "1.7",
    "name" : "Naturaleza, ambiente",
    "description" : "Utilice este campo para palabras que tienen que ver con la naturaleza y el ambiente--el mundo de nuestro entorno. Incluya palabras que se refieran a cómo la gente daña o protege la naturaleza.",
