    "description" : "Utilice este campo para palabras obscenas que tienen que ver con sexo, defecación, muerte, condenación y otros temas que son tabú o temas ofensivos. Es importante revisar el buen uso de las palabras obscenas incluidas en el diccionario. Los hablantes del idioma, deberán seleccionar la palabra que debe o no incluirse. Las palabras obscenas que se incluyan en el diccionario deberán señalarse claramente como tales. La obscenidad se utiliza con frecuencia para intensificar la emoción de una expresión. La obscenidad con frecuencia está asociada con sexo o defecación. El maldecir está con frecuencia asociado con Dios, religión o la inmortalidad. Los insultos con frecuencia involucran el igualar a una persona con un animal que está asociado con características indeseables, cuestionando el linaje/legitimidad, interrogando el carácter de uno, o interrogando la inteligencia/lucidez mental de alguien.",
