  "9.1" : {
    "guid" : "3a2c0773-6b3e-4f8b-909d-c8f84d66d4f4",
    "key" : "9.1",
    "abbr" : "9.1",
    "name" : "Palabras generales",
    "description" : "Utilice la siguiente sección para las palabras que no encajan en ningún otro campo porque son tan comunes que usted puede utilizarlas para hablar sobre cualquier tema. Utilice este campo para las palabras comunes y no específicas que se pueden utilizar en el lugar de cualquier palabra. Algunos idiomas tienen una palabra común que puede reemplazar a un sustantivo o a un verbo. Por ejemplo, algunos idiomas Filipinos utilizan la palabra 'kwan' de esta manera. El alemán coloquial puede utilizar la palabra 'dings' como sustantivo o como verbo. Con frecuencia, esas palabras se utilizan cuando no se puede recordar la palabra específica que se quiere utilizar. En inglés se utiliza la palabra 'blank' cuando se desea omitir una palabra, por ejemplo, cuando se está examinando a alguien y se desea que éste diga la palabra.",
    "value" : "9.1 Palabras generales"
  },
