    "description" : "Muchos idiomas tienen palabras comunes que indican cierta clase de cambio de estado. Esas palabras comunes se pueden utilizar con una amplia variedad de significados específicos. Por ejemplo, en inglés la palabra 'convertirse en' se puede utilizar para un cambio en la identidad, un cambio en la característica, un cambio en la naturaleza, y muchas otras ideas.",
