    "name" : "Componentes del discurso",
    "description" : "Este campo es para fines de la organización y no se debe utilizar ninguna palabra. Utilice los campos de esta sección para las palabras que pertenecen a un componente especial del discurso. Lo mejor es no utilizar estos campos ya que se basan en la gramática y no en el significado. Pero si usted tiene un grupo pequeño de palabras que pertenecen a un componente del discurso y quiere hacer una lista de éstos, puede utilizar estos campos. También puede clasificar las palabras de esta sección si aún no sabe lo que significan",
