    "abbr" : "9.2.1",
    "name" : "Adjetivos",
    "description" : "Utilice este campo para hacer una lista de todos los adjetivos. Si hay muchos adjetivos en su idioma, probablemente no vale la pena incluir una lista de ellos aquí. El programa Shoebox (y otros programas de diccionario) puede clasificar su diccionario por componentes del discurso.",
