    "name" : "Pronombres impersonales",
    "description" : "Utilice este campo para los pronombres que no aluden a una perosona o a una cosa definida, pero se pueden referir a alguien o a cualquier cosa. Ciertos idiomas pueden no tener todos los grupos de pronombres descritos más abajo. Agregue a la gráfica de pronombres cada grupo que encuentre en su idioma.",
