    "description" : "Utilice este campo para las palabras que indican que usted está agregando otro pensamiento al pensamiento anterior. Las palabras de este campo pueden indicar una variedad de vínculos entre las palabras, las frases, las cláusulas o las oraciones. Por ejemplo, las palabras pueden unir a dos cláusulas que son iguales excepto que los sujetos, los objetos o los verbos son diferentes.",
